// src/components/ProximasMantenciones.js

import React, { useState, useEffect } from 'react';

// Función simulada para obtener los datos de próximas mantenciones (puedes reemplazarla con una API real)
const fetchProximasMantenciones = () => {
  // Simulando una llamada a una API
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve([
        { id: 1, vehiculo: "Patente 1", fecha: "2025-05-15", tipo: "Cambio de aceite", kilometraje: 12000 },
        { id: 2, vehiculo: "Patente 2", fecha: "2025-06-01", tipo: "Revisión de frenos", kilometraje: 15000 },
        { id: 3, vehiculo: "Patente 3", fecha: "2025-07-10", tipo: "Reemplazo de bujías", kilometraje: 18000 },
        { id: 3, vehiculo: "Patente 4", fecha: "2025-08-30", tipo: "Balanceo y alineación de ruedas", kilometraje: 18000 },
      ]);
    }, 1000); // Simula un retraso de 1 segundo
  });
};

const ProximasMantenciones = () => {
  const [mantenciones, setMantenciones] = useState([]);

  useEffect(() => {
    const obtenerMantenciones = async () => {
      const data = await fetchProximasMantenciones();
      setMantenciones(data);
    };

    obtenerMantenciones();
  }, []);

  return (
    <div className="proximas-mantenciones">
      <h2>Próximas Mantenciones de Vehículos</h2>
      <table>
        <thead>
          <tr>
            <th>Vehículo</th>
            <th>Fecha</th>
            <th>Tipo de Mantención</th>
            <th>Kilometraje</th>
          </tr>
        </thead>
        <tbody>
          {mantenciones.length === 0 ? (
            <tr>
              <td colSpan="4">Cargando mantenciones...</td>
            </tr>
          ) : (
            mantenciones.map((mantencion) => (
              <tr key={mantencion.id}>
                <td>{mantencion.vehiculo}</td>
                <td>{mantencion.fecha}</td>
                <td>{mantencion.tipo}</td>
                <td>{mantencion.kilometraje} km</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default ProximasMantenciones;
